import React from 'react';
import LoginPage from './LoginPage';
import { useHistory, useLocation } from 'react-router-dom';

export default class LoginHOC extends Component{
  history = useHistory();
  location = useLocation();

  render(){
    return (
      <LoginPage location={this.location} history={this.history}/>
    );
  }
};
